export const Products = (props) => {

    const infos = props.items.map((item) => (
                <div key={item.carClassId}>
                    carClassName=<img src = {item.image} alt={`${item.carClassName} 차량`}/>
                    <p>{item.carClassName}</p>
                    <p>{item.carModel}</p>
                    <p>{item.carTypeTags}</p>
                    <p>{item.discountPercent}</p>
                    <p>{item.drivingDistance}</p>
                    <p>{item.price}</p>
                    <p>{item.regionGroups}</p>
                    <p>{item.year}</p>
                </div>    
            ))

    return(
        <div>
            {infos}
        </div>
    );
}

export default Products;
